import React from 'react';

const Recommendations = ({ recommendations }) => {
  return (
    <div className="recommendations">
      <h2>Recommendations</h2>
      {recommendations.map((rec, i) => (
        <div key={i} className="recommendation">
          <h3>{rec.name}</h3>
          <p>{rec.reason}</p>
        </div>
      ))}
    </div>
  );
};

export default Recommendations;
